import React from 'react';
import PatientForm from '../components/Pre_Medical'; // Import your PatientForm component
import { fillPreMedicalForm } from '../services/api'; // Import the fillPreMedicalForm function

function PreMedicalFormComponent() {
  const handleFormSubmit = (formData) => {
    // Call the fillPreMedicalForm function to submit the form data to the backend
    fillPreMedicalForm(formData)
      .then((response) => {
        // Handle the success response as needed
        console.log('Pre-Medical Form submitted successfully:', response);
        // You can also redirect the user or display a success message.
      })
      .catch((error) => {
        // Handle the error
        console.error('Pre-Medical Form submission error:', error);
        // You can display an error message to the user.
      });
  };

  return (
    <div>
      <h2>Pre Medical Form</h2>
      <PatientForm onSubmit={handleFormSubmit} />
    </div>
  );
}

export default PreMedicalFormComponent;
